import React from "react";
import "./Header.scss";
import logo from "./abm-logo.svg";

const Header = () => {
  return (
    <header>
      <img src={logo} alt="Artistry by Mel logo" class="logo" />
      <nav>
        <ul>
          <li class="nav-link">
            <a href="/">Home</a>
            <div class="line line1"></div>
          </li>
          <li class="nav-link">
            <a href="/" class="work-link">
              My Work
            </a>
            <div class="line line2"></div>
          </li>
          <li class="nav-link">
            <a href="/">Book</a>
            <div className="line line3"></div>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
